import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 八·六戊日己未时断</p><p>六戊日生时己未，羊刃偏官不怕冲；但是为人多性狠，平生衣禄亦无凶。</p><p>戊日己未时，羊刃偏官，戊以己为羊刃，甲为偏官，时上明暗二己为刃，甲木未中合局，若见刑冲破害，刃煞有制，主贵。</p><p>通月旺者平常衣禄，二十年，父母俱失；若不通月气，得寅申者贵。</p><p>戊寅日己未时，时日相穿，忧伤妻子，早苦晚好。</p><p>月通土气，行财官运，贵；水木月，行身旺运，贵。</p><p>戊寅日己未时，先难后易，贵人提携，不贵即富。</p><p>年月透甲制刃，地支午未身旺，煞刃双显，主大贵。</p><p>戊辰日己未时，春冬，行北运，富贵。</p><p>戊午日己未时，羊刃偏官，主人机谋，寿促，不然，妻子难为重立重成。</p><p>午亥年月，金土运，贵；申酉，富。</p><p>戊申日己未时贵，行财官运，发福。</p><p>嫌寅冲煞有凶。</p><p>戊戌日己未时，春，官旺，贵。</p><p>夏印安稳。</p><p>秋平。</p><p>冬孤苦。</p><p>戌月，魁罡格，五六品贵。</p><p>须年月申子辰会财，寅午印绶，己酉伤官，亥卯官煞，各成局面方吉。</p><p>未中戊己土成堆，刑害冲来事亦谐；先暗后明凶变吉，贵人提携出尘埋。</p><p>戊时临己未，六亲骨肉成疏。</p><p>喜逢火印暗中扶，甲乙寅卯为主。</p><p>重谢花开结果，双亲雁行夭孤。</p><p>自为自立自图谋，赖有贵人扶助。</p>",24),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","222卷 八·六戊日己未时断.html.vue"]]);export{f as default};
